import { createSelector } from 'reselect';
import { getIsExperimentsLoading, getExperimentsData, getSelectedExperiment } from './projects';

export const getSelectedExperimentData = createSelector(
    [getIsExperimentsLoading, getExperimentsData, getSelectedExperiment],
    (isExperimentsLoading, experiments, selectedExperimentID) => {
        // if (isExperimentsLoading) { return null; }
        const { experimentsList } = experiments;
        const tmp = experimentsList.filter(experiment => experiment.id === selectedExperimentID);
        debugger;
        console.log(tmp);
    },
);

